import React from 'react';
import PropTypes from 'prop-types';     // prop-types 모듈 사용
import Link from 'next/link';
import { Menu, Row, Col } from 'antd';            // https://ant.design/components/menu/
import styled from 'styled-components';
import { useSelector } from 'react-redux';
import { Button } from 'antd';

const Background = styled.div`
    width: 100%;
    height: 100vh;
    background-color: #FA5A5A
`

const LoginBtn = styled(Button)`
    width: 30%;
`
const MyMenu = styled.ul`
    list-style-type: none;
`
const CHARACTOR = () => {
    return (
        <Background>
        <Row>
            <Col xs={24} md={12} >
                <LoginBtn>로그인</LoginBtn>
            </Col>

            <Col xs={24} md={12} >
                <div>
                    <MyMenu>
                        <li><a style={{color: 'white', display: 'inline'}}>HOME</a></li>
                        <li><a style={{color: 'white', display: 'inline-block'}}>ABOUT</a></li>
                        <li><a style={{color: 'white', display: 'inline'}}>CHARACTOR</a></li>
                        <li><a style={{color: 'white', display: 'inline'}}>HELP</a></li>
                    </MyMenu>
                </div>
            </Col>
        </Row>

    </Background>
    );
};


export default CHARACTOR;
